chung cư 2 pn, 2wc - tiện ích bạt ngàn - giao thông thuận tiện -khu vực đông dân_– 87m2 – 5.45 tỷ.
+ mô tả: 
- chung cư nằm ngay đầu phố đỗ nhuận, gần  công viên hoà bình. cách 1km ra đường võ chí công - xuân la, 500m ra đường phạm văn đồng, đường nguyễn văn huyên kéo dài; 
- giáp với khu ngoại giao đoàn,trường tiều học - trường thcs - trường thpt xuân đỉnh, hàng xóm tòa chung cư 789 xuân đỉnh;
- căn hộ 87m2, t được thiết kế: 02 phòng ngủ + 02 vệ sinh + 01 bếp + 01 phòng khách;
- ban cộng rộng, view đẹp, hướng đông nam mát mẻ, ngắm toàn cảnh thành phố;
- trang bị full nội thất: điều hòa, sofa, bếp,tất cả các đồ nội thất gắn tường.
 nhà chưa nhận sổ, mua bán sang tên hợp đồng với chủ đầu tư .
